import React from 'react';
import {withProvider} from './AppContext';

const ScoreDisplay = (props) => {
    console.log(props);
    return (
        <div>
            <h1>{props.username}</h1>
            <h3>{props.score}</h3>
            <button onClick={() =>this.props.deleteScores()}>Delete</button>
        </div>
    )
}

export default withProvider(ScoreDisplay);
